INSERT INTO `hizmetler` (`hizmet_id`, `hizmet_adi`, `hizmet_tarihi`, `hizmet_image`, `hizmet_aciklama`, `hizmet_url`) VALUES
(6, 'Logo Tasarımı', '30-09-2020 16:30:35', '64603346.png', 'Logo tasarımı bir firmanın kimliği niteliğindedir. Bu sebepten ötürü profesyonel yapılması ve firmayı doğrudan temsil etmesi gerekir. Firmaya uygun renk seçimi ve işletmeyi temsil eden bir ikonun belirlenmesi oldukça önemlidir. İngiltereden bizi tercih eden işletmemize teşekkür ederiz.', '#'),
(9, 'Kurumsal Web Sitesi', '17-05-2021 15:37:19', '56009243.png', 'Hayatımıza internetin girdiği günden buyana teknoloji çok ilerleme katetti ve artık dijital dünyanın önemi dahada arttı. Gün geçtikçe dijitalleşen dünyada işletmenizi web üzerinde de var etmeniz artık oldukça gerekli. İnce Code Web Site Tasarım uzmanı olarak firmanızı veya işletmenizi dijitalde en iyi derecede temsil etmek için güncel teknolojiyi takip ediyor sizlere mobil uyumlu, kaliteli bir görünüme sahip web sayfaları sunuyoruz. ', ''),
(10, 'E-Ticaret Sitesi', '18-05-2021 09:23:03', '77885344.png', 'Bütün işletmelerin online\'a taşındığı bu dönemde sizinde bir e-ticaret siteniz olsun istemez misiniz?  Ürünleriniz hakkında daha çok bilgi daha kolay ulaşım ve inceleme imkanı sağlamak için işletmenizi e-ticarete taşıyın. Ürün bilgilerini ve resimlerini güncel tutarak müşterilerinize daha keyifli bir alışverişin tadını çıkarttırın. Hiç şüphesiz e-ticarette kazanacaklarınızın bir sınırı yok.', ''),
(11, 'Cafe-Restaurant E-Menu', '19-05-2021 17:28:18', '71136645.png', 'Cafe & Restorantınıza en şık ve akıllı tablet menüler tasarlıyoruz. Müşterilerinize alışılmışın dışına çıkarak profesyonel görünümlü E-menü sunmak istemez misiniz? Akıllı dijital menü ile menüye olan masraflarınızı %50 oranında indiriyoruz. Dijital menünüz ile ürünlerinizin fiyat ve görsellerini sürekli güncel tutabilir gelişmiş admin paneli ile en çok bakılan ürünleri tespit edebilirsiniz.', ''),
(12, 'Admin Panel Yapımı', '20-05-2021 17:25:25', '45597947.png', 'Web sitelerinizi güncel tutmak ve sürekli onla ilgilenmek isteyebilirsiniz. Pekiya bu durumda yapacaklarınız neler? 1: Yazılımcınız ile irtibata geçip ondan sitenizi aktif kılmasını belirli bir ücret karşılığı isteyebilirsiniz. 2: Web sitenize admin paneli yazdırıp dilediğiniz zaman dilediğiniz yerinde güncellemeyi siz yapabilirsiniz. Gelişmiş paneller ile içerik eklemek ve güncellemek oldukça kolay ve basittir. Dilediğiniz cihazdan (tablet, laptop,telefon) giriş yapıp anında yeni içerikler ve hizmetlerinizi ekleyebilirsiniz.', ''),
(13, 'Stok Takibi', '21-05-2021 14:18:34', '53089448.png', 'Stok Takibi uygulamamız ile işletmenizin veya deponuzun bütün ürünlerini kolay bir şekilde takip edebileceksiniz. Sipariş verilen ürünleriniz, stokda az olan ürünleriniz, fiyatları ve çok daha fazla detayı ile istediğiniz zaman aralığındaki ürünlerinizi takip edebilir bunlara 7/24 dilediğiniz cihazdan ulaşabilirsiniz. ', ''),
(14, 'Mobil Uygulama Geliştirme', '23-05-2021 14:40:47', '31839653.png', 'Mobil uygulama yaptırmak isityorum?\r\n\r\nGelişen teknoloji ile yeni trend olan mobil uygulamalar pop&uuml;lerliğini olduk&ccedil;a b&uuml;y&uuml;tt&uuml;. Hayatamızda olmazsa olmazımı mobil cihazların gelişimi ile mobil uygulamalarda bir hayli &ouml;nem kazandı. Firmanıza &ouml;zel uygulama geliştirmek artık l&uuml;x&#39;den daha &ccedil;ok gereklilik haline geldi. Sizde ihtiyacınız olan uygulamayı bizimle hayata ge&ccedil;irebilirsiniz.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n', ''),
(23, 'Ön Muhasebe Yazılımları', '07-06-2021', '58329263.png', '&nbsp;İşletmenizin haftalık, aylık ve yıllık gelir ve giderlerini kayıt altına almak daha sonra dilediğiniz zaman g&ouml;z gezdirmek istiyorsanız İnce code ile &ouml;n muhasebe yazlımına merhaba demenin tam vakti.\r\n', ''),
(24, 'Aksaray Web Site Tasarımı', '15-06-2021', '61277364.png', '4 Yılı aşkın bir s&uuml;redir Aksaray&#39;da web tasarım hizmeti vermekteyiz. Firmalara &ouml;zel Kurumsal siteler, E-ticaret Siteleri ve &Ouml;zel Yazılımlar ile web alanında &ccedil;eşitli faliyetlerde bulunmaktayız. Sizlerin sorunlarına en hızlı ve profesyonel &ccedil;&ouml;z&uuml;mler &uuml;reterek b&uuml;y&uuml;menize ve gelişmenize katkı sağlıyoruz.\r\n', ''),
(25, 'Web site tasarımı nasıl yapılır', '16-06-2021', '51262785.png', 'Web site tasarlamanın olduk&ccedil;a fazla yolları vardır elbette. &Ouml;ncelikle belirlememiz gereken kriter nasıl bir site olacağı, net&uuml;r hizmetler vereceği ve ilerde ne değişiklikler&nbsp;yapılabileceğini belirlemek olacaktır. &Ouml;rneğin E-ticaret sitesi kurmak istiyorsak iddalı ve profesyonel bir site olması gerekecektir. Tercihen &ouml;zel yazılım veya Wordpress, Wix, Godady gibi i&ccedil;erik y&ouml;netim scriptleri kullanılabilecektir. Firma i&ccedil;in bir ka&ccedil; bilgilendirme sayfasından oluşan sitelerde &ccedil;okca kullanılan sistemlerdir. B&uuml;t&uuml;n bunları &ouml;ğrenmek kendiniz veya firmanız i&ccedil;in en uygun olanı bulmak biraz zamanınızı alacaktır. Daha sonrasında&nbsp;b&uuml;y&uuml;k geliştirmelerde&nbsp;web tasarım uzmanlarından yardım almanızda gerekecektir. Buy&uuml;zden genelde web tasarım konularında uzman kişilerden s&uuml;rekli destek almanızı tavsiye ederim.\r\n', ''),
(28, 'GOOGLE HARİTA KAYDI (İŞLETME KAYDI) YAPIYORUZ', '29-01-2022', '276136130.png', 'İşletmenizin arama sonu&ccedil;larında g&ouml;z&uuml;kmesi i&ccedil;in Google Harita Kaydınızın yapılması ve optimize edilmesi gereklidir. Biz firmanızı google haritaya ekleyip gerekli t&uuml;m optimizasyonlarını yapıyoruz. &Ouml;rneğin aksaray&#39;da yazılım firmaları arama sonu&ccedil;larında İnce Code adıyla firmamızın profili g&ouml;z&uuml;kmektedir. İşletmenize yapılan yorumlar verilen puan ve yer bildirimleri firmanızı arama spnu&ccedil;larında &ouml;n sıralara taşıyacaktır.\r\n', '');
